var pool = require('./database');
var db = null;

function prepare() {
    db.query('DROP TABLE IF EXISTS images', define);
}

function define() {
    db.query('\
        CREATE TABLE images (\
            id INT AUTO_INCREMENT NOT NULL,\
            latitude DECIMAL(10,7) NOT NULL,\
            longitude DECIMAL(10,7) NOT NULL,\
            image MEDIUMBLOB NOT NULL,\
            PRIMARY KEY(id)\
        ) ENGINE = InnoDB;\
    ', seed);
}

function seed() {
    var entries = [
        [ 46.2430988, 14.3525041, new Buffer('', 'base64') ],
        [ 46.2505884, 14.3466236, new Buffer('', 'base64') ]
    ];
    
    db.query('INSERT INTO images (latitude, longitude, image) VALUES ?', [ entries ], finish);
}

function finish() {
    db.release();
    pool.end();
}

pool.getConnection(function(err, connection) {
    if (!err) {
        db = connection;
        prepare();
    }
});